import React from 'react';
import './coin.css';

const Coin = ({
  name,
  price,
  symbol,
  marketcap,
  volume,
  image,
  priceChange
}) => {
  return (

    <div className='coin-container'>
     <div className="a" style={{display: 'flex'}}><img src={image} /><h2>{name}</h2></div>
     <div className="a"><h2>{symbol}</h2></div> 
     <div className="a"><p>€{price}</p></div> 
     <div className="a"><p>{priceChange}%</p></div> 
     <div className="a"><p>€{volume}</p></div> 
     <div className="a"><p>€{marketcap}</p></div> 
    </div>

  );
};

export default Coin;
